import { View, Text} from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
const Input = () => {
  return (
    <SafeAreaView>
      <Text>Halaman Input Data</Text>
    </SafeAreaView>
  )
}

export default Input;
